import {Component} from "react";

class App extends Component {

    constructor(props) {
        super(props);
        this.state ={
            users:[
                {
                    id:1,
                    name:"guveb Ayvaz",
                    email:"guven@gmail.com"
                },
                {
                    id:1,
                    name:"hilal Ayvaz",
                    email:"guven@gmail.com"
                },
                {
                    id:1,
                    name:"Duru Ayvaz",
                    email:"guven@gmail.com"
                }
            ]
        };
    }
    render() {
        return (
            <div className="container">
                <h4>User App</h4>
            </div>
        );
    }

}

export default App;
